const e=JSON.parse('{"key":"v-280bc4df","path":"/note/golang/open-source-books/the-way-to-go/14/14.14.html","title":"14.14 并行化大量数据的计算","lang":"zh-CN","frontmatter":{},"headers":[],"git":{"updatedTime":1684038853000},"readingTime":{"minutes":1.32,"words":395},"filePathRelative":"note/golang/open-source-books/the-way-to-go/14/14.14.md","excerpt":"<h1> 14.14 并行化大量数据的计算</h1>\\n<p>假设需要处理一些数量巨大且互不相关的数据项，它们从一个 <code>in</code> 通道被传递进来，当我们处理完以后又要将它们放入另一个 <code>out</code> 通道，就像一个工厂流水线一样。处理每个数据项也可能包含许多步骤：</p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>Preprocess（预处理） / StepA（步骤A） / StepB（步骤B） / ... / PostProcess（后处理）\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div></div></div>"}');export{e as data};
